import React from 'react';

const DetailedView = ({ disease, resultType, handleResultClick }) => {
  if (!resultType) return null;

  const renderContent = () => {
    switch (resultType) {
      case 'Disease':
        return <p>{disease.disease}</p>;
      case 'Description':
        return <p>{disease.description}</p>;
      case 'Precaution':
        return (
          <ul style={styles.list}>
            {disease.precautions.map((item, idx) => <li key={idx}>{item}</li>)}
          </ul>
        );
      case 'Medications':
        return (
          <ul style={styles.list}>
            {disease.medications[0].split(', ').map((item, idx) => <li key={idx}>{item}</li>)}
          </ul>
        );
      case 'Workouts':
        return (
          <ul style={styles.list}>
            {disease.workout.map((item, idx) => <li key={idx}>{item}</li>)}
          </ul>
        );
      case 'Diets':
        return (
          <ul style={styles.list}>
            {disease.diets[0].split(', ').map((item, idx) => <li key={idx}>{item}</li>)}
          </ul>
        );
      default:
        return null;
    }
  };

  return (
    <div style={styles.detailedView}>
      {renderContent()}
      <div style={styles.buttonGroup}>
        <button style={styles.resultButton} onClick={() => handleResultClick('Disease')}>Disease</button>
        <button style={styles.resultButton} onClick={() => handleResultClick('Description')}>Description</button>
        <button style={styles.resultButton} onClick={() => handleResultClick('Precaution')}>Precaution</button>
        <button style={styles.resultButton} onClick={() => handleResultClick('Medications')}>Medications</button>
        <button style={styles.resultButton} onClick={() => handleResultClick('Workouts')}>Workouts</button>
        <button style={styles.resultButton} onClick={() => handleResultClick('Diets')}>Diets</button>
      </div>
    </div>
  );
};

const styles = {
  detailedView: {
    marginTop: '20px',
    padding: '10px',
    border: '1px solid #ddd',
    borderRadius: '8px',
    backgroundColor: '#f9f9f9',
    width: '100%',
    maxWidth: '800px', // Optional: limit width for better layout
    marginBottom: '20px', // Adds space after detailed view
  },
  list: {
    listStyleType: 'disc',
    paddingLeft: '20px',
    marginTop: '10px',
    fontSize: '16px',
  },
  buttonGroup: {
    display: 'flex',
    flexDirection: 'column',
    gap: '10px',
    marginTop: '15px', // Adds space above button group
  },
  resultButton: {
    backgroundColor: '#007bff',
    color: 'white',
    padding: '10px',
    border: 'none',
    borderRadius: '4px',
    cursor: 'pointer',
    fontSize: '16px',
    width: '100%', // Make the button fill the container
  },
};

export default DetailedView;
